function App() {
  return (
    <Router>
      <div className="container mt-4">
        <Routes>
          <Route path="/node/:id" element={<NodePage />} />
          <Route path="/" element={<RootsPage />} />  {/* Updated route */}
          <Route path="/topics/new" element={<CreateTopic />} />
